import React, { Component, Fragment } from "react";
import { connect } from "react-redux";
import PropTypes from "prop-types";
import { getClos, deleteClos } from "../../actions/clos";
export class Clos extends Component {
  static propTypes = {
    clos: PropTypes.array.isRequired
  };
  //component load then
  componentDidMount() {
    this.props.getClos();
  }
  render() {
    return (
      <Fragment>
        <h2>Course Learning Outcomes</h2>
        <table className="table table-stripped">
          <thead>
            <tr>
              <th>ID</th>
              <th>CODE</th>
              <th>DESCRIPTION</th>
              <th />
            </tr>
          </thead>
          <tbody>
            {this.props.clos.map(clo => (
              <tr key={clo.id}>
                <td>{clo.id}</td>
                <td>{clo.code}</td>
                <td>{clo.description}</td>

                <td>
                  <button className="btn btn-danger btn-sm">Delete</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </Fragment>
    );
  }
}

//state of redux
const mapStateToProps = state => ({
  clos: state.clos.clos
});
export default connect(mapStateToProps, { getClos, deleteClos })(Clos);
